**Reasoning:** With veterinarian in space 5, pharmacy must be at an end (1 or 7) but cannot be adjacent to vet, so it must be next to optometrist. If pharmacy in 1, optometrist in 2, and restaurants in 4 and 7. If pharmacy in 7, optometrist in 6, and restaurants in 1 and 4. In both cases, space 4 has a restaurant. Other options are not always true: optometrist not always in 2 (only if pharmacy in 1), pharmacy not always in 7, shoe store not always in 6, toy store not always in 3. Thus, C must be true with high confidence.

